/*
 * $key     : Chiave da ricercare nella request http
 * $default : Valore di default assegnato in caso non venga trovato un valore
 **/
function getParam($key='',$default=null,$cast='') {
    $response = "";
    
    if ($key != '') {
        if (isset($_POST[$key]))
            $response = $_POST[$key];
        else if (isset($_GET[$key]))
            $response = $_GET[$key];
        else
            $response = $default;
    } else {
        $response = $default;
    }
    
    if ($cast != '') {
        if ($cast == 'int')
            $response = (int)$response;
        else if ($cast == 'double')
            $response = (double)$response;
        else if ($cast == 'string')
            $response = (string)$response;
        else if ($cast == 'stringEscaped')
            $response = escape((string)$response);
    }
    
    return $response;
} 

/*
 * $var     : Variabile da testare     
 * $key     : Chiave da ricercare nella request
 * $default : valore di default assegnato in caso non venga trovato un valore
 **/
function checkVar($var='',$key='',$default=null,$cast='') {
    $response = "";
    
    if (/*is_array($var) && */$key != '' || $key === 0) {
        if (isset($var[$key])) {
            $response = $var[$key];
        } else {
            $response = $default;
        }
    } else {
        if (isset($var))
            $response = $var;
        else
            $response = $default;
    }
    
    if ($cast != '') {
        if ($cast == 'int')
            $response = (int)$response;
        else if ($cast == 'double')
            $response = (double)$response;
        else if ($cast == 'string')
            $response = (string)$response;
        else if ($cast == 'stringEscaped')
            $response = escape((string)$response);
    }
    
    return $response;
}

    /*
    * @return: Controllo sintassi email
    */

    function controlloEmail($variabile) {
        if (trim($variabile) == "")
            return false; // controllo che ci sia una sola @ nella stringa
        $num_at = count(explode('@', $variabile)) - 1;
        if ($num_at != 1)
            return false; // controllo la presenza di ulteriori caratteri "pericolosi"
        if (strpos($variabile, ';') || strpos($variabile, ',') || strpos($variabile, ' '))
            return false;
        if (preg_match('/^[\w\.\-\+]+@\w+[\w\.\-]*?\.\w{1,4}$/', $variabile))
            return true;
        else
            return false;
    }


/*
 * @return: Ritorna la data in formati diversi
 */
function formato_data($data = '', $tipo = 1) {
    $risp = '';
    
    $dataOrig = $data;
    if (in_array($tipo,array(1,'MYSQL_to_IT'))) { //da formato MySql ad italiano
        $data = explode("-", $data);
        $risp = $data[2] . "/" . $data[1] . "/" . $data[0];
    } elseif (in_array($tipo,array(2,'IT_to_MYSQL'))) { //da formato italiano a MySql
        $data = explode("/", $data);
        $risp = $data[2] . "-" . $data[1] . "-" . $data[0];
    } elseif (in_array($tipo,array(3,'IT_to_numeric'))) { //da formato italiano a numerico MySql
        $data = explode("/", $data);
        $risp = $data[2] . $data[1] . $data[0];
    } elseif (in_array($tipo,array(3,'numeric_to_MYSQL'))) { //da formato numerico a data MySql        
        $risp = date("Y-m-d", strtotime("$data"));
    }

    if ($dataOrig == '0000-00-00')
        $risp = '';
        
    return $risp;
}

/*
 * @return: Ritorna la stringa decodificata
 */

function superentities($str, $rsqo) {
    // get rid of existing entities else double-escape
    $str2 = '';

    if ($rsqo)
        $str = str_replace("'", "&rsquo;", $str);
    
    $str = html_entity_decode(stripslashes($str), ENT_QUOTES, 'UTF-8');
    $ar = preg_split('/(?<!^)(?!$)/u', $str);  // return array of every multi-byte character
    foreach ($ar as $c) {
        $o = ord($c);
        if ((strlen($c) > 1) ||
            ($o < 32 || $o > 126) ||
            ($o > 33 && $o < 40) ||
            ($o > 59 && $o < 63)
        ) {
            // convert to numeric entity
            $c = mb_encode_numericentity($c, array(0x0, 0xffff, 0, 0xffff), 'UTF-8');
        }
        $str2 .= $c;
    }
    return $str2;
}

/*
 * @return: Ritorna la stringa decodificata
 */
function replacespecialchars($str="", $no_replace = array()) {
    if (!is_array($no_replace))
        $no_replace = array();
    
    $str = superentities($str, in_array("'", $no_replace) ? 0 : 1);
    $caratteri = array("�", "'", "'", "�", "�", '�', '�', '�');
    $codici = array("&Agrave;", "&rsquo;", "&rsquo;", '&ldquo;', '&rdquo;', '&ndash;', '&euro;', '&rsquo;');
    $caratteri_temp = $codici_temp = array();
    if (count($no_replace)) {
        foreach ($caratteri as $key => $c) {
            if (!in_array($c, $no_replace)) {
                $caratteri_temp[] = $c;
                $codici_temp[] = $codici[$key];
            }
        }
    } else {
        $caratteri_temp = $caratteri;
        $codici_temp = $codici;
    }
    return html_entity_decode(str_replace($caratteri_temp, $codici_temp, stripslashes(trim($str))));
}

/*
 * @return: Ritorna la stringa decodificata
 */
function decodeString($str='') {
    $search = array(chr(0xe2) . chr(0x80) . chr(0x98),
        chr(0xe2) . chr(0x80) . chr(0x99),
        chr(0xe2) . chr(0x80) . chr(0x9c),
        chr(0xe2) . chr(0x80) . chr(0x9d),
        chr(0xe2) . chr(0x80) . chr(0x93),
        chr(0xe2) . chr(0x80) . chr(0x94),
        chr(226) . chr(128) . chr(153),
        '’', '“', '�<9d>', '�"', '�  ', "_");

    $replace = array("'", "'", '"', '"', ' - ', ' - ', "'", "'", '"', '"', ' - ', ' ', ' ');
    
    return str_replace($search, $replace, $str);
}

/*
* @return: Esegue l'escape di mysql
*/

function escape($stringa) {
    global $mysqli;

    $return = '';
    if (!is_array($stringa))
        $return = $mysqli->real_escape_string($stringa);
    else
        $return = $stringa;

    return $return;
}

