//funzione per compilare la select dell'anno
function compilazioneAnni(){
    //contiene l'anno da cui si inizia a compilare
    $yearStart=2020;

    $yearList=array();
    $yearFinish=date("Y");
    $number=$yearFinish-$yearStart;
    
    for($i=$number; $i>=0; $i--){
        $yearList[$yearStart+$i]=$yearStart+$i."/".$yearStart+$i+1;
    }

    if(date('m')<=8){
        unset($yearList[$yearFinish]);
    }

    return $yearList;
}